class CuHistory
{
    const CURRENT_YEAR = 2022;

    /** Get years [label] => total */
    static function years()
    {
        $years = array();
        for ($year = CuHistory::CURRENT_YEAR; $year >= 1994; $year--) {
            if ($year == 2021 || $year == 2020)  // pandemic
                continue;
            $years[substr(strval($year), -2)] = 0;
        }
        $keys = array_keys($years);
        foreach(CuHistory::data() as $name => $active_years) {
            $index = 0;
            foreach ($active_years as $active) {
                if ($active)
                    $years[$keys[$index]]++;
                $index++;
            }
        }
        return $years;
    }

